    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Take away food: $10 – $17</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">A cup of coffee / tea: $2.50</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Fast food (McDonalds, Burger King, KFC): $5 – $10</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <h3 style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Meal Deals &amp; Happy Hour:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">You can avail special meal deals at many restaurants in cities around lunch-time and bars that have happy hours (usually between 5pm and 6pm or 6pm and 7pm). Happy hours means you can buy cheap drinks (if you drink!). Hunt for great money-saving local bargains.</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Free Magazines and Newspapers:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Check out the free magazines that are distributed throughout cities. Look out for them as these are freely distributed in subways and on the streets, in cafes, shops and bars, in fact wherever you go! Look out for highly valuable information ABOUT JOBS besides other entertaining news about what’s on in your city!</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Click on the following link to compare the average cost of living in your country with the cost of living in Sydney:</p>
    <p style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">
        <a href="http://moneymanager.com.au/tools/calculators/costofliving.html">http://moneymanager.com.au/tools/calculators/costofliving.html</a>
    </p>
    <p style="padding-top: 4pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">
        <span class="h2" style=" background-color: #FF0;">Student Life in Australia:</span>
    </p>
    <p style="padding-top: 14pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Living life in Australia as an International Student is FUN! If you are living in glamorous Melbourne, Sydney or Adelaide, you can live life to its fullest pleasures. But as an International Student you will be lost like an “Alice in Wonderland”. Hence we at SIEC have complied some very useful information to help you settle down faster and easier!</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">
        <span class="h2" style=" background-color: #FF0;">Application Procedure:</span>
    </p>
    <h3 style="padding-top: 14pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Intakes:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">There are generally TWO Intakes in Australia – February and July of every year. Yet, very few Universities offer multiple intakes in September and November.</p>
    <p style="padding-top: 2pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">Strongly Recommended: Make your applications 7-8 months prior to the intake deadlines. Universities generally take around 4-6 weeks to process your applications.</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Documents needed:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">An application</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Resume</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Statement of Purpose</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Mark Sheets/Transcripts</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Passing Certificates (from Class 10 onwards)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Two Reference Letters (from colleges/employers)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Passport copy or Birth Certificate</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">IELTS Score Sheet</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;text-align: left;">
        <span class="h2" style=" background-color: #FF0;">Entry Requirements:</span>
    </p>
    <h3 style="padding-top: 14pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Undergraduate – Bachelors:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">A good academic record in High School Certificate or 12 years of schooling</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">Some courses such as Computing and Engineering will require Mathematics and /or Science as pre-requisites</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">6.0 IELTS</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <h3 style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Postgraduate – Masters:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">A good academic record in Bachelor’s degree obtained from a recognized university is necessary</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Any work experience in the field will be helpful</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">For MBA programs at some Universities students need to have work experience along with their Bachelor’s degree</p>
</li>
<li data-list-text="">
    <p style="padding-top: 4pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">6.5 IELTS</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;text-align: left;">
        <span class="h2" style=" background-color: #FF0;">Visa Guideline:</span>
    </p>
    <h3 style="padding-top: 14pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Simple Australia Student Visa Application Procedure</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Submit your application for admission to your chosen university.</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Receive an Offer Letter</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">Complete the Electronic Confirmation of Enrolment (eCoE) (It is advisable to wait till you get the guidance from the university to obtain your eCoE).</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">They University will provide you information regarding how to apply and what documents are required to be enclosed with your application.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">To complete the process, make payment of the prescribed tuition fees</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">See if you need to pay other fees such as Overseas Student Health Cover and Application Fee (if any).</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">What is eCoE – Electronic Confirmation of Enrolment?</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">An eCoE is the certificate issued by the DIBP for the students to confirm the acceptance of their admission in the university the student has applied, and which is an essential requirement for the processing of the visas application or for visa extension.</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">In either case, the importance of an eCoE can never be underestimated or ignored.</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Before the issuance of an eCoE, students have to undergo a Pre-Visa Assessment (PVA) based on the nationality and principal course of study.</p>
    <p style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;line-height: 115%;text-align: justify;">To be eligible for the student visa, students have to enroll in an Australian university/institution and receive an eCoE.</p>
    <p style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The eCoE Form includes the critical information such as the course starting date, ending date and other codes used by the DIBP (Department of Immigration and Border Protection) that students have to be aware of.</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Typically, an eCoE will be issued after the university receives the student’s tuition fee.</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">A copy of your eCoE must be submitted to your local DIBP (Department of Immigration and Border Protection) office before your Australia Student Visa can be issued.</p>
    <h3 style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">English Language Requirements:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">If you are an international student belonging to a non-English speaking (Native speakers of English language) country, you have to take an IELTS/TOEFL test to prove your English language abilities.</p>
    <h3 style="padding-top: 4pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Essential Conditions for Australia Student Visa</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;text-align: left;">International Students have to:</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Pursue a consistent study program that is recognized by the Australian government</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Fulfill all the requirements of the study program</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Maintain a valid enrolment – attendance requirements may apply</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">And can work without getting any additional permission</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">And are not allowed to work for more than 40 hours fortnightly during their semester, except any specific permission.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">Sustain their OSHC (Overseas Student Health Cover) all the time during their stay in Australia.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">And Students under the age of 18 years have to arrange for their accommodation, support and general welfare provisions certified by the Australian government – DIBP.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">In case of changing the residence or other arrangements students have to get the written approval from the Government of Australia.</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;line-height: 115%;text-align: left;">Note: International Students cannot stay in Australia beyond their visa expiry date, unless it is an extremely critical situation.</p>
    <p class="s1" style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Required Documents – A CHECKLIST</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Students applying for Australian Student Visa have to carry the following list of documents to file for processing their applications:</p>
</li>
<li data-list-text="">
    <p style="padding-top: 12pt;padding-left: 40pt;text-indent: -17pt;text-align: justify;">Visa Application Charge payable through Credit Card</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: justify;">Additional Information Form 1221</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Electronic Confirmation of Enrolment (eCoE) issued by your education provider for the course(s) you are undertaking stating the course, total tuition fees, duration and the course start date along with OSHC</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Letter of Offer issued by your education provider for the course(s) you are undertaking stating the course, total tuition fees, duration and the course start date.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Original Passport (min 6 months validity)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Copy of the passport (Notarized)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Four recent passport sized photographs (Light colour background)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Statement of Purpose (Original – Signed by the student)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: justify;">Academic Certificates (ORIGINALS)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Copies Academic Certificates (Notarized)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Work Experience Certificate (on the original company letter heads)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Copies of the Work Experience Certificates (Notarized)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: justify;">IELTS Score Card (ORIGINAL) / TOEFL / PEARSON</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Copy of the IELTS Score Card (Notarized)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Evidence of Liquid Funds</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Evidence of Income</p>
</li>
<li data-list-text="">
    <p style="padding-top: 4pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Affidavit of Support by the Sponsors</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Student Affidavit, if the student is self-sponsoring for his studies in Australia</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Evidence of Relationship (Dependents)</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">Documents of dependents included in the application- Birth Certificate, Marriage certificate and evidence of marriage (Photos etc.)</p>
    <p style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: justify;">
        <span class="h2" style=" background-color: #FF0;">Work Permits for Students:</span>
    </p>
</li>
<li data-list-text="">
    <p style="padding-top: 14pt;padding-left: 40pt;text-indent: -17pt;text-align: left;">Working Opportunities during Study</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: left;">Students are allowed to work 40 hours fortnightly during study and full-time during vacations.</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: justify;">Post Study Work Permit:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Upon completion of Bachelor, Master or Doctoral degree from recognized institution, student is eligible to obtain two-year post study work permit. Now any qualification below degree level will be considered for PSW. Study resulting in a diploma level qualification or trade qualification will not be considered.</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: justify;">Conditions of PSW:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Student must have completed a single qualification comprised of minimum two academic years study or multiple qualifications completed in a total period of at least two academic years.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Qualification must be through the Commonwealth Register of Institutions and Course for Overseas Students (CRICOS).</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Qualification must complete and conducted in English language.</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: left;">Student has been physically remained in Australia for minimum two-year duration of course.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Student must have hold valid student visa.</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Qualification used to fulfill the Australian study requirement must have been undertaken at any education provider which is accrediting to offer degree level programs.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Any qualification will be counted only once towards the Australian study requirement for PSW and any stay for English language proficiency courses (ELICOS) cannot be used to meet the Australian study requirement.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 114%;text-align: justify;">Two academic years study is considered 92 weeks of study, but students may take longer to complete the course, but will only be credited with the number of weeks that CRICOS determines as a standard duration. Like, if student complete a course in 92 weeks but according to CRICOS it is 78 weeks course, then student will only receive credit of 78 weeks.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;line-height: 13pt;text-align: justify;">Failed subjects will not be considered.</p>
</li>
<li data-list-text="">
    <p style="padding-top: 1pt;padding-left: 41pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Study completed outside Australia cannot be considered to fulfill the Australian study requirement.</p>
</li>
<li data-list-text="">
    <p style="padding-top: 4pt;padding-left: 41pt;text-indent: -18pt;line-height: 114%;text-align: justify;">An eligible degree level of qualification is minimum Bachelor’s degree or above like Masters by coursework degree, Masters (extended) degree, Masters by research degree or Doctoral degree. Remember degree level courses which are packaged with a Graduate Certificate or Graduate Diploma course may be considered if Australian study requirement is met. Example: Students who complete a Graduate Diploma in Educational Studies which articulates (or leads) into a Master of Education are able to use both the study at the Graduate Diploma and at the master’s level towards meeting this requirement. Example: Students who complete a Bachelor of Arts and then a Graduate Diploma in Asia-Pacific Studies will only have study undertaken at the Bachelor degree level considered, as the Graduate Diploma did not contribute towards the conferral of an eligible degree level qualification.</p>
    <h3 style="padding-top: 11pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Jobs:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
    <p style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">For many one of the top priorities on arrival in Australia is finding a job, either part-time or full- time, depending on the type of visa you hold. For some of you, this might be casual work, such as working in a café or restaurant or as a waiter/waitress, for others you may have skills enough to work in an office.</p>
    <h3 style="padding-top: 12pt;padding-left: 5pt;text-indent: 0pt;text-align: left;">Part Time Employment:</h3>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;">
        <br />
    </p>
</li>
<li data-list-text="">
    <p style="padding-left: 41pt;text-indent: -18pt;line-height: 112%;text-align: justify;">Students can work up to 22 hours a week (anywhere) during course time and 40 hours per week full-time during vacation periods if they have been granted a work permit.</p>
</li>
<li data-list-text="">
    <p style="padding-left: 40pt;text-indent: -17pt;text-align: left;">Average earnings: Casual Jobs are available (A$15-18 per hour) as PT work option</p>
